import React from 'react';
import Lobby from './Lobby';

class Switch extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {
		return (
			<div>
              { this.props.children }
			</div>
		)
	}
}

class Router extends React.Component {
  render() {
    return(
      <Switch>
        <li><Lobby/></li>
      </Switch>
	)
  }
}

export default Router;
